import React, { Component } from 'react';
import NavBar from './Components/NavBar/NavBar'
import Resume from './Components/Resume/Resume'


class App extends Component {

  constructor(props) {
    super(props);
  }

  state = {
    currentPage: null,
  }

  changeWord = (newWord) => {

    if (newWord === 'Resume') {
      this.setState({
        currentPage: <Resume />
      })
    }

    console.log("changeWord called")

  }



  render() {

    if (this.state.word === "Resume" && this.state.currentPage != <Resume /> ) {
      this.setState({
        currentPage: <Resume />
      })
    }

    return (
      <div>
        <h1>ryan slevin</h1>
        <NavBar changeWord={this.changeWord}/>
        {this.state.currentPage}
      </div>
    );

  }

}

export default App;
